<!DOCTYPE html>
<html lang="it">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="shortcut icon" href="data:image/jpeg;base64," type="image/x-icon">
    <link rel="icon" href="data:image/jpeg;base64," type="image/x-icon">

    <title>API TO-DO-LIST</title>

    <!-- Third party libraries -->
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap@5.2.2/dist/css/bootstrap.min.css">
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.2.0/css/all.min.css">
    <script src="https://unpkg.com/vue@3/dist/vue.global.js"></script>
    <script src="https://cdn.jsdelivr.net/npm/axios/dist/axios.min.js"></script>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.2.1/css/all.min.css">

    <!-- Custom css -->
    <link rel="stylesheet" href="css/style.css">
</head>

<body>
    <div id="app">
        <main class="container py-5 pb-5  ">
            <h1 class="mb-5 text-white text-center">To Do List </h1>

            <div class="row justify-content-center  ">
                <div class="col-md-6  ">

                    <ul class="list-group list-group-flush rounded">
                        <li class="list-group-item d-flex justify-content-between">
                            <span>HTML</span>
                            <i class="fas fa-trash text-danger pt-1"></i>
                        </li>
                        <li class="list-group-item d-flex justify-content-between">
                            <span>CSS</span>
                            <i class="fas fa-trash text-danger pt-1"></i>
                        </li>
                        <li class="list-group-item d-flex justify-content-between">
                            <span>JAVASCRIPT</span>
                            <i class="fas fa-trash text-danger pt-1"></i>
                        </li>
                        <li class="list-group-item d-flex justify-content-between">
                            <span>VUE + VITE</span>
                            <i class="fas fa-trash text-danger pt-1"></i>
                        </li>
                    </ul>
                </div>

            </div>






            <div class="text-center ">
                <form action="">
                    <div class=" row mb-3 justify-content-center">
                        <div class="col-md-6">

                            <label for="" class="form-label ">Nome</label>
                            <input type="text" class="form-control" name="firstName" v-model="formData.firstName">
                        </div>
                    </div>
                </form>
                <button class="btn btn-secondary">Annulla</button>
                <button class="btn btn-primary">Aggiungi</button>
            </div>




        </main>
    </div>

    <script src="js/main.js"></script>
</body>

</html>